import React from 'react';

function Menu() {
    return (
        <div className="menu">
            <button onClick={() => console.log("My menu clicked")}>My Menu</button>
            <button onClick={() => console.log("Add recipe clicked")}>Add Recipe</button>
            <button onClick={() => console.log("Schedule clicked")}>Schedule</button>
            <button onClick={() => console.log("Plan clicked")}>Plan</button>
        </div>
    );
}

export default Menu;
